import React, { useState, useEffect, useContext } from 'react';
import { AuthContext } from '../context/authContext';
import axios from 'axios';

const AdminDashboard = () => {
  const { auth } = useContext(AuthContext);
  const [usuarios, setUsuarios] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [activeTab, setActiveTab] = useState('conductores');
  const [formData, setFormData] = useState({
    rut: '',
    nombre: '',
    apellido: '',
    password: '',
    telefono: '',
    role: 'conductor',
  });
  const [editingId, setEditingId] = useState(null);

  useEffect(() => {
    fetchData();
  }, [activeTab]);

  const fetchData = async () => {
    try {
      const response = await axios.get(`http://localhost:3000/api/admin/${activeTab}`, {
        headers: { Authorization: `Bearer ${auth.token}` }
      });
      setUsuarios(response.data);
      setLoading(false);
    } catch (err) {
      setError(`Error al cargar ${activeTab}`);
      setLoading(false);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (editingId) {
        await axios.put(`http://localhost:3000/api/admin/${activeTab}/${editingId}`, 
          { ...formData, role: activeTab === 'conductores' ? 'conductor' : 'pasajero' },
          { headers: { Authorization: `Bearer ${auth.token}` } }
        );
      } else {
        await axios.post(`http://localhost:3000/api/admin/${activeTab}`, 
          { ...formData, role: activeTab === 'conductores' ? 'conductor' : 'pasajero' },
          { headers: { Authorization: `Bearer ${auth.token}` } }
        );
      }
      fetchData();
      resetForm();
    } catch (err) {
      setError(`Error al ${editingId ? 'actualizar' : 'crear'} ${activeTab.slice(0, -2)}`);
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:3000/api/admin/${activeTab}/${id}`, {
        headers: { Authorization: `Bearer ${auth.token}` }
      });
      fetchData();
    } catch (err) {
      setError(`Error al eliminar ${activeTab.slice(0, -2)}`);
    }
  };

  const handleEdit = (usuario) => {
    setFormData({
      rut: usuario.rut,
      nombre: usuario.nombre,
      apellido: usuario.apellido,
      telefono: usuario.telefono,
      role: usuario.role,
    });
    setEditingId(usuario._id);
  };

  const handleInputChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const resetForm = () => {
    setFormData({
      rut: '',
      nombre: '',
      apellido: '',
      password: '',
      telefono: '',
      role: 'conductor',
    });
    setEditingId(null);
  };

  if (loading) return <div>Cargando...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div>
      <h1>Dashboard de Administrador</h1>
      <div>
        <button onClick={() => setActiveTab('conductores')}>Conductores</button>
        <button onClick={() => setActiveTab('pasajeros')}>Pasajeros</button>
      </div>
      <form onSubmit={handleSubmit}>
        <input name="rut" value={formData.rut} onChange={handleInputChange} placeholder="RUT" required />
        <input name="nombre" value={formData.nombre} onChange={handleInputChange} placeholder="Nombre" required />
        <input name="apellido" value={formData.apellido} onChange={handleInputChange} placeholder="Apellido" required />
        {!editingId && (
          <input name="password" type="password" value={formData.password} onChange={handleInputChange} placeholder="Contraseña" required />
        )}
        <input name="telefono" value={formData.telefono} onChange={handleInputChange} placeholder="Teléfono" />
        <button type="submit">{editingId ? 'Actualizar' : 'Agregar'} {activeTab.slice(0, -2)}</button>
        {editingId && <button type="button" onClick={resetForm}>Cancelar edición</button>}
      </form>
      <ul>
        {usuarios.map(usuario => (
          <li key={usuario._id}>
            {usuario.nombre} {usuario.apellido} - RUT: {usuario.rut} - Teléfono: {usuario.telefono}
            <button onClick={() => handleDelete(usuario._id)}>Eliminar</button>
            <button onClick={() => handleEdit(usuario)}>Editar</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AdminDashboard;
